import React from 'react'

const Aqua = (props) => {

    // store name

  return (
  <div className='overflow-y-hidden '>
    <div id='top_banner' style={{'backgroundImage':"url('https://images.pexels.com/photos/956999/milky-way-starry-sky-night-sky-star-956999.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2')"}} className='p-20  text-white w-screen '>
      <p className='text-4xl'>
      {props.data['store_name']}
      </p>
      <p id='description'>
          Let us make your time valuable.
      </p>
    </div>
    
    <section id='body' className='flex w-screen'>
          {/*  */}
          <section id='shop_products' className='border border-black rounded-lg w-1/2 m-4 p-4  ' style={{maxHeight:'33rem'}}>
            <div className='m-4   overflow-scroll ' style={{maxHeight:'29rem'}}>

            {props.data.products.map((item, index)=>{
               return (
                <div className='border border-black p-3 m-3 flex rounded-lg'>
                    <img src={item.product_image_url} className='w-28 h-auto m-3 rounded-lg'/>
                    <div>

                    <p className='text-lg'>{item.product_name}</p>
                    <p className='text-sm text-gray-500'>{item.product_description}</p>
                    <p className='text-red-600 text-lg font-bold'>Rs.{item.product_price}</p>
                    {/* <p>Our Current Rating <p>3.4</p></p> */}
                    </div>
                </div>
               )
            })}
            </div>

          </section>
      </section>
  </div>
  )
}

export default Aqua
